import React from "react";
import "./courses.css";
import scrum from "../../assets/scrum.png";
import linkedin from "../../assets/linkedin.png";
import cenecoop from "../../assets/cenecoop.png";
import IPAI from "../../assets/ipai.png";
import UNA from "../../assets/una.png";
import Uandes from "../../assets/uandes.png";
import camcop from "../../assets/camcop.png";
import UAB from "../../assets/uab.png";
import UNAM from "../../assets/unam.png";
import accenture from "../../assets/accenture.png";
import certificate from "../courses/data"


const Courses = () => {
  const certifications = {
    certifications: [
      {
        title: "Scrum Fundamentals Certified (SFC™)",
        subtitle: "SCRUMStudy",
        logo_path: scrum,
        certificate_link:
          "https://www.scrumstudy.com/certification/verify?type=SFC&number=873873",
        alt_name: "SCRUMStudy",
        color_code: "#dddddd",
      },
      {
        title: "Office/Microsoft 365: Trabajo colaborativo",
        subtitle: "Linkedin",
        logo_path: linkedin,
        certificate_link:
          "https://www.linkedin.com/learning/certificates/02cff069cbc420bfcd8f2facc75b9449d420e1672a6a3727b52a20f50b145727?trk=backfilled_certificate",
        alt_name: "linkedin",
        color_code: "#dddddd",
      },
      {
        title: "Fundamentals of customer service",
        subtitle: "Linkedin",
        logo_path: linkedin,
        certificate_link:
          "https://www.linkedin.com/learning/certificates/68c910c6da27dabbfedff2a230c94dcab213ff0623b40f13340804d16191cf54?trk=backfilled_certificate",
        alt_name: "linkedin",
        color_code: "#dddddd",
      },
      {
        title: "Customer service",
        subtitle: "CENECOOP",
        logo_path: cenecoop ,
        alt_name: "cenecoop",
        color_code: "#dddddd",
      },
      {
        title: "English conversational",
        subtitle: "IPAI Language school",
        logo_path: IPAI,
        alt_name: "IPAI",
        color_code: "#dddddd",
      },
      {
        title: "Receptionist",
        subtitle: "UNA",
        logo_path: UNA,
        alt_name: "UNA",
        p: '',
        color_code: "#dddddd",
      },
      {
        title: "Accounting",
        subtitle: "CENECOOP",
        logo_path: cenecoop,
        alt_name: "cenecoop",
        color_code: "#dddddd",
      },
      {
        title: "Fundamentals of business finance",
        subtitle: "Universidad de los andes",
        logo_path: Uandes,
        certificate_link:
          "https://www.coursera.org/account/accomplishments/verify/YQZ2HW6WTXXP",
        alt_name: "business",
        color_code: "#dddddd",
      },
      {
        title: "Dynamic tables",
        subtitle: "CAMCOP",
        logo_path: camcop,
        certificate_link:
          "https://www.coursera.org/account/accomplishments/certificate/NRANJA66Y2YA",
        alt_name: "CAMCOP",
        color_code: "#dddddd",
      },
      {
        title: "Microsoft 365",
        subtitle: "Universidad Autónoma de Barcelona",
        logo_path: UAB,
        certificate_link:
          "https://www.coursera.org/account/accomplishments/certificate/QLKRRN8VGDLT",
        alt_name: "UAB",
        color_code: "#dddddd",
      },
      {
        title: "Accounting for non-accountants",
        subtitle: "Universidad Nacional Autónoma de México",
        logo_path: UNAM,
        certificate_link:
          "https://www.coursera.org/account/accomplishments/certificate/P5L3T3D9NJZ7",
        alt_name: "UNAM",
        color_code: "#dddddd",
      },
      {
        title: "Customer service",
        subtitle: "Accenture",
        logo_path: accenture,
        certificate_link:
          "https://fcas.cclearning.accenture.com/cas/login?service=https%3A%2F%2Ffundaula-lms.cclearning.accenture.com%2Flogin%2Findex.php",
        alt_name: "accenture",
        color_code: "#dddddd",
      },
    ],
  };

  return (
    <section className="courses section" id="courses">
      <h2 className="section__title">Courses</h2>

      <div className="courses__container container grid">
        {/* Map through the certifications array to render each certificate */}
        {certifications.certifications.map((certificate, index) => (
          <div className="cert-card" key={index}>
            <div className="content">
              <a
                href={certificate.certificate_link}
                target="_blank"
                rel="noopener noreferrer"
              >
                <div className="content-overlay"></div>
                <div
                  className="cert-header"
                  style={{ backgroundColor: certificate.color_code }}
                >
                  <img className="logo_img" src={certificate.logo_path} alt={certificate.alt_name}/>
                </div>
                <div className="content-details fadeIn-top">
                  <h3 className="title">Certificate</h3>
                </div>
              </a>
            </div>
            <div className="cert-body">
              <h2 className="cert-body-title">{certificate.title}</h2>
              <h3 className="cert-body-subtitle">{certificate.subtitle}</h3>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Courses;
